var images = procureImages()
var grids = procureGrids()

var imgID int
var img image.Image

var gridID int
var grid [2]uint

func init() {
	rand.Seed(time.Now().UnixNano())

	imgID = rand.Intn(len(images))
	gridID = rand.Intn(len(grids))

	img = images[imgID]
	grid = grids[gridID]
	err := os.Setenv("GOMAXPROCS", strconv.Itoa(runtime.NumCPU()))
	if err != nil {
		log.Fatalf("failed to set GOMAXPROCS: %v", err)
	}
}

func TestSlice(t *testing.T) {

	t.Parallel()

	if testing.Short() {
		t.Logf("TESTSLICES-%d_[%v]", imgID, grid)
		testSlice(t, img, grid, false)
		return
	}

	for i := range images {
		for g := range grids {
			t.Run(fmt.Sprintf("TESTSLICES-%d_[%v]", i, grid), func(t *testing.T) {
				i, g := i, g
				t.Parallel()
				testSlice(t, images[i], grids[g], true)
			})
		}
		//break //FIXME : remove when done
	}

}

func testSlice(t *testing.T, img image.Image, grid [2]uint, short bool) {

	tiles := imageslicer.Slice(img, grid)

	expectedNoOfTiles := grid[0] * grid[1]

	if expectedNoOfTiles == 0 {
		if len(tiles) > 0 {
			t.Errorf("[testSlice] expected 0 tiles got %d", len(tiles))
		}
		return
	}

	if err := imageslicer.CheckSlice(tiles, grid); err != nil {
		t.Errorf("[testSlice] failed for img-%d due to %s", imgID, err)
		return
	}

	if err := validateSlices(t, img, tiles, grid, short); err != nil {
		t.Errorf("[testSlice] %v", err)
	}

}

func FuzzSlice(f *testing.F) {

	func() { //generate corpus

		seed := time.Now().UnixNano()
		rand.Seed(seed)

		f.Logf("[seed] %v", seed)

		for i := 0; i < 10; i++ { //TODO add more
			//imgID := rand.Intn(len(images))
			//randNo := uint(rand.Intn(500)) + 5 //TODO consider using non squara grids to test the strength

			//f.Add(uint(imgID), randNo, randNo)
			fuzzer := fuzz.New()
			var fuzzInt uint16
			fuzzer.Fuzz(&fuzzInt)
			f.Add(uint(fuzzInt), uint(fuzzInt), uint(fuzzInt))

			if !testing.Short() {
				break //short circuiting
			}
		}
	}()

	f.Fuzz(func(t *testing.T, imgID uint, rows uint, column uint) {

		t.Run(fmt.Sprintf("[%d,%d] %d", rows, column, imgID), func(t *testing.T) {

			imgID, rows, column := imgID, rows, column

			t.Parallel()

			t.Logf("[%d,%d] %d", rows, column, imgID)

			if int(imgID) >= len(images) {
				t.Skipf("invalid imgID-%d", imgID)
				//t.SkipNow()
			}

			img := images[imgID]

			if img == nil {
				t.Logf("invalid imgID-%d", imgID)
				//t.Errorf("invalid img-%d", imgID)
				t.SkipNow()
			}

			grid := imageslicer.Grid{rows, column}

			testSlice(t, img, grid, true)
		})

	})

}

func BenchmarkSlice(b *testing.B) {

	if img == nil {
		b.Errorf("invalid img-%d", imgID)
	}

	b.ResetTimer()

	gridID := 0
	grid := grids[gridID]

	b.Logf("[bTestCase] img %d grid %v iter %d\n", imgID, grid, b.N)

	for i := 0; i < b.N; i++ {

		b.StartTimer()

		imageslicer.Slice(img, grid)

		b.StopTimer()
	}

}

var compareColor = func(color1, color2 color.Color) (flag bool) {

	rC1, gC1, bC1, aC1 := color1.RGBA()

	rC2, gC2, bC2, aC2 := color1.RGBA()

	//flag = color1.RGBA() == color2.RGBA() //Doesn't work runtime error.!

	flag = rC1 == rC2 && gC1 == gC2 && bC1 == bC2 && aC1 == aC2

	return
}

