func lsDir(dirPath string) (files []string, err error) {
	files_, err := os.ReadDir(dirPath)

	if err != nil {
		err = fmt.Errorf("lsDir failed due to-%s", err)
		return
	}

	for _, file := range files_ {
		path_ := fmt.Sprintf("%s/%s", dirPath, file.Name())
		if file.IsDir() {
			files__, _ := lsDir(path_)
			files = append(files, files__...)
		} else {
			files = append(files, path_)
		}
	}

	return
}

// validate all the slices with
func validateSlices(t *testing.T, srcImg image.Image, tiles []image.Image, grid imageslicer.Grid, short bool) (err error) {

	joinedImg, err := imageslicer.Join(tiles, grid)

	if err != nil {
		return fmt.Errorf("[ValidateSlice] %s", err)
	}

	var compareCoords = func(coord [2]int) (err error) {
		x := coord[0]
		y := coord[1]

		colorI := srcImg.At(x, y)
		colorJ := joinedImg.At(x, y)

		if compareColor(colorI, colorJ) {
		} else {
			err = fmt.Errorf("[compareColor] (x,y)-(%v,%v)", x, y)
			return
		}
		return
	}

	coords := make(chan [2]int, 100)

	shapeI := srcImg.Bounds()
	shapeJ := joinedImg.Bounds()

	if shapeI != shapeJ {
		t.Log("[SHAPE] pixels lost after split")
	}

	var produceCoords = func() {

		maxY := shapeJ.Max.Y
		minY := shapeI.Min.Y

		maxX := shapeJ.Max.X
		minX := shapeI.Min.X

		t.Logf("[produceCoord] start")
		defer t.Logf("[produceCoord] ended")

		defer close(coords)

		if short {
			rand.Seed(time.Now().UnixNano())

			for i := 0; i < 5000; i++ {

				if err != nil {
					return
				}

				x := rand.Intn(maxY-minY+1) + minY
				y := rand.Intn(maxX-minX+1) + minX
				coord := [2]int{x, y}

				coords <- coord

			}
		} else {
			for x := minX; x < maxX; x++ {
				for y := 0; y < maxY; y++ {

					if err != nil {
						return
					}

					coord := [2]int{x, y}

					coords <- coord

				}
			}
		}
	}

	var consumeCoords = func() {
		var wg sync.WaitGroup
		//errChan := make(chan error)
		var errMutex sync.Mutex

		errCtx, cancel := context.WithTimeout(context.Background(), time.Hour*6) //FIXME don't context timeout

		t.Logf("[consumeCord] started")

		var noOfCordsTested atomic.Int64

		for coord := range coords {

			wg.Add(1)
			go func(coord [2]int) {
				defer wg.Done()

				select {
				case <-errCtx.Done():
					//don't compare
					t.Logf("[consumeCord] ended prematurely")
					return
				default:
					err1 := compareCoords(coord)
					noOfCordsTested.Add(1)

					if err1 != nil {

						if errMutex.TryLock() {
							errMutex.Lock()
							cancel()
							err = err1
						} else {
							t.Logf("[consumeCord-%v] err already raised already", coord)
							return
						}
						//errMutex.Unlock()
					}
				}
			}(coord)

			if !testing.Short() {
				time.Sleep(time.Millisecond) //to prevent overload
			}

		}

		wg.Wait()

		cancel()

		log.Printf("[consumeCord] tested %d", noOfCordsTested.Load())

		/*	close(errChan)

			for err1 := range errChan {
				err = err1 //combine errors
				//break
			}
		*/
	}

	/*
		testCoords := make(chan [2]int,1)

		testCoords <- [2]int{shapeI.Min.X, shapeI.Min.Y}*/

	go produceCoords()

	consumeCoords()

	return
}

